import Banjo from "./images/Banjo.png";
import Byleth from "./Byleth.png";

export const characters = [
    {
        id: 1,
        name: "Banjo & Kazooie",
        series: "Banjo & Kazooie",
        images: Banjo
    },

    {
        id: 2,
        name: "Byleth",
        series: "Fire Emblem",
        images: Byleth
    }

]
